<script setup>
import LogoSvg from '@/assets/svg/logo.svg';
import NatureSvg from '@/assets/svg/nature.svg';
import { setToken } from '@/utils';
import api from './api';
import { useMessage } from 'naive-ui';
import { ref, reactive } from 'vue';
import { useDebounceFn } from '@vueuse/core';
import QrCodeImg from '@/assets/images/qrcode.jpg';

const state = reactive({
  loading: false,
  showModal: false,
});

const router = useRouter();

const formUserRef = ref(null);

// const formEmailRef = ref(null);

const message = useMessage();

const formUser = ref({
  username: '',
  password: '',
  login_type: 'username',
});

// const formEmail = ref({
//   email: '',
//   code: '',
//   login_type: 'email',
// });

const rulesForUser = {
  username: {
    required: true,
    message: '请输入姓名',
    trigger: 'blur',
  },
  password: {
    required: true,
    trigger: ['input'],
    validator(rule, value) {
      if (!value) {
        return new Error('请填写密码');
      } else if (!/^(?!([^(0-9a-zA-Z)])+$).{8,32}$/.test(value)) {
        return new Error('密码长度8-32位');
      }
      return true;
    },
  },
};

// const rulesForEmail = {
//   email: {
//     required: true,
//     message: '请输入邮箱',
//     trigger: 'blur',
//   },
//   code: {
//     required: true,
//     message: '请输入验证码',
//     trigger: ['input'],
//   },
// }

const handleForget = useDebounceFn(() => {
  state.showModal = true;
}, 500);

const handleClose = () => {
  state.showModal = false;
};

const onSignupForUser = useDebounceFn(async () => {
  state.loading = true;
  formUserRef.value?.validate(async (errors) => {
    if (!errors) {
      try {
        let res = await api.loginApi(formUser.value);
        setToken(res.token);
        router.push('/chat');
        $message.success('登录成功');
      } catch (error) {
        console.log(error.error.error);
        $message.error(error.error.error);
      } finally {
        state.loading = false;
      }
    } else {
      console.log(errors);
      state.loading = false;
      message.error('请按要求填写账号信息');
    }
  });
}, 600);
</script>
